        - id: ETSI GS ZSM 012 V1.1.1 (2022-12)
          type: ETSI
          primary: true
        docnumber: ETSI GS ZSM 012 V1.1.1 (2022-12)
        date:
        - type: published
          value: 2022-12
        contributor:
        - organization:
            name:
            - content: European Telecommunications Standards Institute
              language:
              - en
              script:
              - Latn
